insert into recenzie values(1, 291, 130, 5.00, 'I made these recently for a holiday party.  I have never seen anything go so fast!<br /><br />They were very easy to make-- just add a few ingredients, mix, and throw them in the oven.  I will definitely be buying and making these again.', sysdate);
insert into recenzie values(2, 461, 478, 5.00, 'This is amongst the best Karachi Halwa I have eaten. Not rubbery or super chewy like a lot of the other ones...just perfect.. individually wrapped pieces in the box.', sysdate);
insert into recenzie values(3, 458, 376, 5.00, 'I spotted the brand while watching "Everyday Italian" on the Food Channel. I drink it alone, as well as, adding it to brownies to make expresso brownies. Wonderful!', sysdate);
insert into recenzie values(4, 490, 16, 2.00, 'My pug is, perhaps, too spoiled when it comes to treats. I ordered the chicken and the beef and gave her the chicken first. She turned her nose away. I chopped it and added gravy. She ate the gravy. So I cannot attest to the effectiveness of the product.', sysdate);
insert into recenzie values(5, 434, 490, 5.00, 'Works with chicken fish beef or pork. Fast easy and makes it taste excellent. Plus buying in bulk is more than 50% off from box stores', sysdate);
insert into recenzie values(6, 212, 25, 2.00, 'I would we willing to try this product, and have six envelopes in my cupboard, but unfortunately the instructions are in German.  Maybe I can hire an interpreter??', sysdate);
insert into recenzie values(7, 121, 180, 1.00, 'I am an avid consumer of Jack Links Beef Steak Nuggets.  This batch is stale, dry and almost tasteless.  I can purchase these in even remote gas stations and they taste juicy and wonderful. I am too lazy to return them but will never buy them over the internet again.', sysdate);
insert into recenzie values(8, 167, 465, 5.00, 'I have twin girls, they both loved the Vegetable Turkey Dinner.  It was one of their favorite baby foods.  Great price.', sysdate);
insert into recenzie values(9, 327, 295, 1.00, 'This is not XAPP Recovery as is listed, it is XAPP Energy. The difference is that XAPP Energy contains caffeine.', sysdate);
insert into recenzie values(10, 318, 85, 5.00, 'Finally, a product that gives you that extra boost you need for anything from travel delays to the overdue stack of paperwork. You feel the effects instantly with more energy and a higher concentration level.  It stays with you and does not leave you feeling dopey or spent when it wears off.', sysdate);
insert into recenzie values(11, 264, 299, 5.00, 'They are a healthier chip with less salt and fat, which I like better than the over-salted regular chips on the market.  The flavor is great and they are nice and crunchy. Absolutely worth a try!', sysdate);
insert into recenzie values(12, 363, 321, 5.00, 'My Bengal kitten loves this stuff. His fur feels like mink/cashmere, and he has a very healthy diet with this brand wet food.', sysdate);
insert into recenzie values(13, 378, 102, 3.00, 'This product is not sweet enough for me and tastes better with marshmellows already in the cup while brewing. Watery texture was a disappointment.', sysdate);
insert into recenzie values(14, 360, 206, 4.00, 'After the tasting of the "Watermelon and Strawberry" flavor I was pleasantly surprised at how good this one tasted. Imagine a carbonated juice that is 100% natural and is not overwhelming to the taste buds... this one is a real keeper! Light, Refreshing, and Great flavor keeps us coming for more!', sysdate);
insert into recenzie values(15, 146, 429, 1.00, 'I was disappointed by these eucalyptus leaves - they have a stale, oregano-like smell. Ask your local florist to get you some fresh leaves!', sysdate);
insert into recenzie values(16, 452, 413, 5.00, 'it has good tast and crunchy. I bought black sesame before, it is good too. highly recommanded.', sysdate);
insert into recenzie values(17, 328, 310, 5.00, 'We found these sugar-free caramels to be luxuriously delicious! a pinch of sea salt heightenes the buttery sweet flavor.<br />Price is a little high but worth it for the quality!', sysdate);
insert into recenzie values(18, 276, 464, 2.00, 'Too much of the white pith on this orange peel making the product overly bitter and diluting the real good taste of the orange zest.', sysdate);
insert into recenzie values(19, 234, 229, 5.00, 'I really love this product!  It taste so good without all the fat and heart burn.  I like to mix it with strawberry jelly, equal parts and spread on my toast.  It has only 1.5 g of fat while peanut butter has 17g/ serving.  It is a guilty pleasure with little fat and calories.', sysdate);
insert into recenzie values(20, 496, 429, 5.00, 'Was skeptical about the quality of hot chocolate from a K cup but Grove Square is amazing.  It is just as good as making it from scratch but without the fuss.  The milk chocolate is mild, the dark has enough bite to make it interesting and the peppermint is perfect for after dinner.', sysdate);
insert into recenzie values(21, 96, 372, 5.00, 'Altoids are my favorite mint and this is the way to buy them to last for a while.  Save money and get them sent straight to my door.  Usually get 4 of the double boxes of 6 per box.  Definitely worth the savings.', sysdate);
insert into recenzie values(22, 301, 192, 5.00, 'The price was excellent and the tea arrived quickly.  This is where I will be buying my tea in the future.', sysdate);
insert into recenzie values(23, 334, 451, 3.00, 'I prefer rich, strong coffee and this product is a bit bland for my taste', sysdate);
insert into recenzie values(24, 168, 187, 5.00, 'Bengal spice is just perfect either for Ice tea or for hot tea! Also it make the Chai latte special! Thanks!', sysdate);
insert into recenzie values(25, 64, 477, 5.00, 'Great value if you buy it as a subscribe and save item, and I love that it automatically comes to me.  These are great and they taste really good, making me think that we bought a very high quality product for our child.', sysdate);
insert into recenzie values(26, 282, 292, 4.00, 'My dogs are bone lovers.  These are a little messy but my dogs love them.  Very good choice for the avid bone chewer.  To insure freshness, I did freeze the unused bones for future use.', sysdate);
insert into recenzie values(27, 368, 439, 5.00, 'These are the best cheese puffs I have ever had, a sentiment shared by my coworkers and boss.', sysdate);
insert into recenzie values(28, 470, 121, 1.00, '... get this type of sugar any other way than through ordering it because the shipping is INSANE!  The sugar is fine but for the price of the shipping, it was not worth it.', sysdate);
insert into recenzie values(29, 442, 456, 5.00, 'I really like these.  They are so light and airy, almost like chips instead of cookies!  The flavor is that yummy OREO chocolate we all know and love!', sysdate);
insert into recenzie values(30, 80, 471, 5.00, 'These are great treats!, love that these are all natural!  Plus my puppy loves the size of them easy for him to eat', sysdate);
insert into recenzie values(31, 195, 322, 5.00, 'Wonderful!  A great buy for the money - easy to cook and healthy with a rich, nutty flavor!! I would recommend these to everyone.', sysdate);
insert into recenzie values(32, 383, 52, 5.00, 'This is not for puppies. These are very hard and good for cleaning teeth. My 6 year old German Shepard and border collie mix loves these. The first time she had one, she played with it. Once she had the nerve to really chop down on it, she was in heaven and asked for more.', sysdate);
insert into recenzie values(33, 153, 303, 5.00, 'If you love peanut butter but hate the fat and sugar, then this product is for you. It is fantastic in smoothies and shakes--has a real peanut butter taste. At 45 calories a serving, I have it almost every day with my Shakeology! I will always keep this in the house.', sysdate);
insert into recenzie values(34, 289, 488, 5.00, 'Good quality tea, and I like having a variety pack with the best flavors in one box. The price your pay on amazon.com is really great and beats supermarket by far.', sysdate);
insert into recenzie values(35, 380, 112, 5.00, 'This stuff worked out great for my Disco Ball Birthday Cake.  My customer loved it! Check it out [...]<br />If you are looking for a great way to add that little extra something for your treats, you found it.', sysdate);
insert into recenzie values(36, 197, 44, 2.00, 'While good quality, it was not at all what I expected. It smelled like caramel and vanilla, but it tasted like straight black coffee. I was pretty disappointed.', sysdate);
