insert into recenzie values(413, 37, 28, 5.00, 'This is the best cayenne that I have used.The taste and aroma is a bit more mellow than other 90,000 HU cayenne powder from the past,but definetly delivers the kick!!!', sysdate);
insert into recenzie values(414, 238, 287, 5.00, 'The Flamin Buffalo has just the right amount of heat and flavor combined.  I wish I could buy the flavor so I could put them on my wings.  Very good product.', sysdate);
insert into recenzie values(415, 412, 274, 3.00, 'I split this can with my spouse.  I would have given it 2 stars, he gave it 3.  Nice idea, 100% carbonated juice, but the taste is pretty mild.  Not really what I would call refreshing.  Good idea, though, I would try it in other flavors.', sysdate);
insert into recenzie values(416, 145, 488, 5.00, 'these are really hard so, besides being good for them, they are great for their teeth. All three of my dogs love these treats, even my fussy Chi. I highly recommend these doggy treats.', sysdate);
insert into recenzie values(417, 231, 39, 5.00, 'This was just too cute. Has a great story on the bottom to go along with the tug boat theme. The cookies were fresh and tasted good.', sysdate);
insert into recenzie values(418, 251, 207, 5.00, 'Being what you would call a chip connoisseur was looking forward to trying these.  Great chips.', sysdate);
insert into recenzie values(419, 256, 245, 4.00, 'My pitbull, Sammy, loves these treats! they are useful for training as well as do not make her breath smell overly bad.', sysdate);
insert into recenzie values(420, 318, 316, 5.00, 'I used to take sudafed for my stuffy nose. I tried this tea and felt relief immediately. I usually drink this tea twice a week and have not yet felt the stuffy nose. Would highly recommend.', sysdate);
insert into recenzie values(421, 216, 434, 5.00, 'It used to be $24.99 for a six pack. Went up $10 Dollars in a year outrageous. The product is great but not that great or worth the price hike.', sysdate);
insert into recenzie values(422, 446, 479, 5.00, 'I am impressed at how easy these are to use, much better than the one that you can buy from Keurig.<br />Great company to buy from when i go through these will reorder again', sysdate);
insert into recenzie values(423, 211, 389, 5.00, 'I was sceptical at first but after I tried the first bag, I was hooked.  Very easy to prepare.  I microwave these for a minute and a half and they come out perfect.  Nice and salty.  Fresher than the ones you get in bags at the store.  The hardest part is waiting for them to cool.', sysdate);
insert into recenzie values(424, 165, 96, 5.00, 'IMHO. There is simply not a better beverage on Earth. Since I need to add  some more words see prior sentence.', sysdate);
insert into recenzie values(425, 410, 430, 5.00, 'Got this in a K Cup sampler, definitely on my reorder list.  Very smooth, no bitter after taste, dark coffee.  So far one of the best, tied with Caribou Mahogany.  If you like good strong coffee with out the bitter after taste, this K Cup is perfect.', sysdate);
insert into recenzie values(426, 210, 292, 5.00, 'Very nice Tea.<br />I enjoy an Earl Grey that has a strong aroma and taste of Bergamot oil (the citrus flavor added)<br />Others are good, but this one is great.', sysdate);
insert into recenzie values(427, 431, 142, 5.00, 'I was browsing around on Amazon looking for gifts and was very pleased to see my favorite sauce on here. I will just order and have shipped to my friends. Habanero is my favorite, I love the heat and the tangy spiciness. I also love the pineapple. You will not go wrong ordering this up.', sysdate);
insert into recenzie values(428, 124, 458, 5.00, 'Its great to be able to get sugar this way.Its not good to eat but if you are going to use sugar at least this is not processed to an unhealthy state on top of what sugar does to your body,and i am helping the  fair trade farmers.It is a good thing all around.I am happy i can get it in Amazon.', sysdate);
insert into recenzie values(429, 477, 120, 5.00, 'These are my favorites and I have reordered more than once.  Perfect for desert without all the calories and is soooo good.  Cant find these locally so go to Amazon for my candy fix.', sysdate);
insert into recenzie values(430, 218, 188, 5.00, 'The price was excellent and the tea arrived quickly.  This is where I will be buying my tea in the future.', sysdate);
insert into recenzie values(431, 114, 51, 5.00, 'My dogs just love this food. The service is always fast and reliable.', sysdate);
insert into recenzie values(432, 283, 259, 4.00, 'Delicious cookies.  I actually thought I was ordering the white chocolate chunk cookies, not the chewy, but definitely enjoyed these.  The only down side, is these seem awfully small.', sysdate);
insert into recenzie values(433, 293, 454, 2.00, 'Product is good; my cats like it.  But the price just keeps climbing.  I will have to train my cats to eat cheaper cat food.', sysdate);
insert into recenzie values(434, 334, 53, 5.00, 'These are just about the most sinfully delish brownies I have ever had..I made them with applesauce substitution and no one noticed they were fat free.....gluten free pantry makes the best mixes', sysdate);
insert into recenzie values(435, 405, 8, 5.00, 'I donate this product to the local SPCA dog trainer. He swears by it. He only gives one or two a day to each dog so it last a while.', sysdate);
insert into recenzie values(436, 154, 416, 3.00, 'I enjoyed this soup.  It was flavorful with a nice blend of spices.  I will buy it again.', sysdate);
insert into recenzie values(437, 273, 460, 3.00, 'I should have been more aware of the price at local stores for this product.  Walgreens had these exact almonds for $2 less/per bag that week.  They are delicious, though.', sysdate);
insert into recenzie values(438, 136, 28, 5.00, 'Melitta Pods are an inexpensive alternative to k-cups  that also save in the amount of material you have to throw away. Buyer Beware: Pods vary GREATLY in the amount of coffee they have in them. These allow for a good size cup of coffee.', sysdate);
insert into recenzie values(439, 284, 413, 3.00, 'The chocolate on the stick was all melted and all the sticks were stuck with oneanother. The product and the concept is good but you will be better off buying it from a supermarket or directly get it from someone visiting Japan.', sysdate);
insert into recenzie values(440, 228, 428, 5.00, 'A dark coffee that has no bitterness and is smooth as silk. Always use quality filtered water and a clean coffee maker if you want a great brew!', sysdate);
insert into recenzie values(441, 126, 149, 5.00, 'I love this in the morning.  Gives you some get up and go without caffeine, although it does taste good when added to coffee.  Best way to mix is to add to a little bit of water until fully disolved, then fill the cup up.', sysdate);
insert into recenzie values(442, 95, 173, 5.00, 'Previously I bought some mustard seed that was unbearably bitter, but the mustard I made with this seed is very tasty and (after mellowing a few days) not bitter at all. Pleasantly spicy.', sysdate);
insert into recenzie values(443, 26, 376, 1.00, 'There was absolutly no scent or flavor to this.When I brought home truffles from Aosta in Italy they were wonderful and cost less. These were worthless.', sysdate);
insert into recenzie values(444, 345, 293, 4.00, 'Soft and slightly chewy candy is optimal (not gummy) to me and these are that. The flavors are good but not great. They are heavily coated with sugar to sweeten them up as they are not sweet without the sugar coating. I will purchase them again.', sysdate);
insert into recenzie values(445, 280, 293, 3.00, 'This product has a nice smooth taste with the additional tanginess of tangerine.<br />It also has a little bit of a sweetness to it but syrupy sweet.<br />Not lingering or noticeable aftertaste.', sysdate);
insert into recenzie values(446, 482, 207, 5.00, 'I like a dark rich coffee and this is a tad different.  It seems much smoother and<br />I tend to nearly crave it when I have a slightly acid stomach.  It sounds odd and<br />I know I drink too much coffee but this fills that acid tummy niche.', sysdate);
insert into recenzie values(447, 468, 380, 5.00, 'great coffee--this was way too much to pay for it, but i could not find it anywhere else at the time.  i feel a taken advantage of price-wise and probably would not order again.', sysdate);
insert into recenzie values(448, 122, 429, 5.00, 'we bought these after seeing a show called unwrapped, we have never heard of microwavable pork rinds, we absalutely love them!! and order them regularly.', sysdate);
insert into recenzie values(449, 57, 177, 5.00, 'This is an excellent blend perfect for any time. Was really surprised by the quality, flavor and finish.', sysdate);
insert into recenzie values(450, 322, 403, 5.00, 'These bones are pricey but my German Shepard loves them. Because the bones are so dense and heavy they take a lot longer to devour, hence the name, Busy Bone.', sysdate);
insert into recenzie values(451, 286, 195, 5.00, 'Grove Square Milk Chocolate Cocoa k cups are great! I usually make hot cocoa from scratch with milk over the stove. I thought this was easier and delicious. To add creaminess I put in either a splash of milk or a shot of whipped cream--perfect!', sysdate);
insert into recenzie values(452, 183, 317, 5.00, 'These cookies are just wonderful!!! The chocolate is deep, dark, rich and melts very nicely in your mouth.  I would say that it is a bittersweet chocolate and very finely made. These cookies give the chocolate lover a satisfying chocolate experience. Do not hesitate to buy them!', sysdate);
insert into recenzie values(453, 277, 29, 5.00, 'I was very happy with the speed of the delivery and the quality of the treats.  My dogs love them.', sysdate);
insert into recenzie values(454, 195, 381, 5.00, 'This powdered peanut butter delivers the taste but not the calories.  With half the calories of regular peanut butter, indulgence is no longer a big deal.  Love this product.', sysdate);
insert into recenzie values(455, 135, 176, 5.00, 'I have to admit I love this tea, I put splenda in it and the taste is so wonderful. I have probably went through 7 6pack boxes this year alone, not counting the other teas i drink. This is a must try hot or cold..', sysdate);
insert into recenzie values(456, 369, 346, 5.00, 'This is the better coffee I have found in a K Cup. Deep, rich, smooth flavor. No bitterness. Worth the few extra cents per cup.', sysdate);
insert into recenzie values(457, 193, 172, 5.00, 'After 20-30 minutes you do feel alot more relaxed, reminded my of smoking a certain item when I was younger. Tastes great to boot!', sysdate);
insert into recenzie values(458, 403, 173, 5.00, 'My puppy, Megabyte, is a very picky puppy.  After spending hundreds of dollars on finding treats that she will eat.  These are one of only two.', sysdate);
insert into recenzie values(459, 149, 481, 3.00, 'This is really a normal taste coffee. I would not buy more after I finish this one. In fact, I will still be sleepy after drinking two cups!', sysdate);
insert into recenzie values(460, 318, 340, 1.00, 'These look like noodles, but after that there is no comparing this product to pasta.  The texture is rubbery and there is no flavor.  If you love pasta, you will not love this product.', sysdate);
insert into recenzie values(461, 404, 200, 5.00, 'Great option for excellent taste, price, and convenience. A repeat customer on these! We order these now in the 36 pack instead of getting at the grocery store.', sysdate);
insert into recenzie values(462, 157, 83, 5.00, 'This quality product is my dogs favorite healthy chew treat.  They enjoy the Purina Busy Bone, immensely.  They prefer this treat to rawhide chews and do not quit on the Purina Busy Bone until it is finished.', sysdate);
insert into recenzie values(463, 223, 134, 5.00, 'This is great!  It smells great!  I love all of the vegetables in it.  Texture is not chunky and is eaten very well by my triplets, even the one with just 4 teeth.', sysdate);
insert into recenzie values(464, 380, 411, 5.00, 'Glutino crackers taste better than any of the other gluten free crackers that I have tried. It is nice that there are so many choices available for those that need alternatives.', sysdate);
insert into recenzie values(465, 129, 4, 2.00, 'This used to be a good product before they started watering it down, which is why I quit buying it.', sysdate);
insert into recenzie values(466, 469, 95, 5.00, 'I was a little bit concerned because some of the reviews for the other Cafe Altura Organic coffees are not very good, but I decided to try this one anyhow.  Glad I did.  This is a really great French roast - one of my favorites.  We will be buying this one again!', sysdate);
insert into recenzie values(467, 302, 485, 5.00, 'This coffee is not too strong, not too weak.  This is the best I have made through my Keurig so far and I will continue to order this brand and blend!', sysdate);
insert into recenzie values(468, 394, 369, 5.00, 'I finally have found a natural sugar substitute that has the added benefit of having a low glycemic index. Agave is delicious! I have recommended it to many friends, and it is very economical to purchase the 46oz bottles.', sysdate);
insert into recenzie values(469, 450, 280, 5.00, 'My vet recommended this years ago for my cat who has a digestive tract the size of dental floss. Always got at Pet Smart. Cheaper on Amazon and delivered right to my door.', sysdate);
insert into recenzie values(470, 241, 294, 1.00, 'All of the items listed on the description were not included in the box.  I was missing at least 4 food items.', sysdate);
insert into recenzie values(471, 215, 161, 5.00, 'I have always liked Oberto sausage and these short bite sized links are very handy.', sysdate);
insert into recenzie values(472, 247, 270, 5.00, 'Excellent cat food for mature cats and an excellent value.  For $1 more you get twice as much as buying it at a pet store.', sysdate);
insert into recenzie values(473, 183, 101, 3.00, 'This is an effective product for producing milk however my 2 month old wasnt getting full from my milk because it produces an abundance of foremilk which is watery and not enough hindmilk which is the creamy stuff. Also my son got diaper rash and was gassy.', sysdate);
insert into recenzie values(474, 101, 247, 5.00, 'This is not for puppies. These are very hard and good for cleaning teeth. My 6 year old German Shepard and border collie mix loves these. The first time she had one, she played with it. Once she had the nerve to really chop down on it, she was in heaven and asked for more.', sysdate);
insert into recenzie values(475, 256, 354, 5.00, 'I have lived with the hardest dog in the world to give a pill to for 14 years (Lab mix).  Pill Pockets make all the difference in getting her the meds she takes on a daily basis.  Worth the money!', sysdate);
insert into recenzie values(476, 304, 313, 1.00, 'I am still waiting for my order. It has been over a month and still nothing has come. I have other orders i made weeks after that have come.', sysdate);
insert into recenzie values(477, 380, 73, 5.00, 'Taken is taken but after you have a lot of different kinds you tend to establish a taste favorite. Basically if the price is good go for it.', sysdate);
insert into recenzie values(478, 369, 398, 5.00, 'How can you go wrong with buying these in bulk for less than $3 per unit when they can run as high as $5 per unit retail?', sysdate);
insert into recenzie values(479, 343, 199, 5.00, 'When i want a very good medium roast i reach for Starbucks House Blend and when i want a very good dark blend i reach for Starbucks Verona.<br />Both full bodied coffees. Even the aroma is tantalizing!', sysdate);
insert into recenzie values(480, 349, 478, 5.00, 'Our dog loves this stuff.  Ground up and sprinkled on his dry food he just gobbles it up.  No additives or fillers no carbs. We also use as a treat.  Best price at Amazon and quick delivery.', sysdate);
insert into recenzie values(481, 161, 407, 5.00, 'I bought the Chef Boyardee Variety Pack for my son who is in college.  The variety pack is a welcome quick fix meal for him during finals and before he heads off to work or classes.', sysdate);
insert into recenzie values(482, 457, 348, 5.00, 'Yogi Teas are the highest quality--organic, earth-friendly, and flavorful. I prefer them to any other brand. The calming tea is slightly spicy and relaxing; the packaging is good for the environment. I love reading the exercises and philosophical messages on the box. Yogi Tea is the bomb!', sysdate);
insert into recenzie values(483, 41, 325, 1.00, 'It is a good thing the can is so small. The product is several cuts below Sunny Delight. Terrible!', sysdate);
insert into recenzie values(484, 462, 95, 5.00, 'Have bought this from the folks who prepare it and I must say, this is the absolute best item I have ever tasted. They make this at a farm in Benson, AZ and it tastes like heaven. Highly recommend it for everything...I tend to slice up apples and dip them. Have tried it on toast as well.', sysdate);
insert into recenzie values(485, 17, 113, 5.00, 'The only treat my dog gets! Totally good, and well worth the subscription price. The snacks are a great nutrition benefit for him too.', sysdate);
insert into recenzie values(486, 175, 499, 5.00, 'I ordered this as a christmas present for my Daughter and Son in law. He tried it the day after Christmas and gave it 2 thumbs up.', sysdate);
insert into recenzie values(487, 39, 32, 5.00, 'love the ease of having green natural tea anywhear any time . tastes great i love this stash green tea', sysdate);
insert into recenzie values(488, 399, 492, 5.00, 'We enjoy Green Mountain Coffee Nantucket Blend K-Cups so much that I subscribe for a monthly delivery.  There are other coffees we like but Nantucket Blend is our favorite for our Breakfast Brew.  The price is reasonable for K-Cups too.', sysdate);
insert into recenzie values(489, 52, 269, 5.00, 'Quite often macadamia nuts are salted. These, instead, are raw, natural, with nothing added: just delicious macadamia nuts, as they come out of their shell.<br />If you are a fan of macadamias, you have found the right seller!', sysdate);
insert into recenzie values(490, 251, 226, 3.00, 'Have had this gum from other sources and always liked it. This particular shipment seems to have much less peppermint flavor than before...could be it is older gum(there is no expiration date on it) or they are making it with less peppermint now. Otherwise I received this order very quickly.', sysdate);
insert into recenzie values(491, 403, 378, 5.00, 'the true test is that our cats really loves the grass we grow from these seeds! and they grew very easily in pots, too.', sysdate);
insert into recenzie values(492, 109, 251, 2.00, 'I love Wolfgang Puck products but the coffee is very disappointing.<br />There is a weak flavor - almost tastes diluted!<br />Some troll must have changed out all the real Puck products!<br />Libbie', sysdate);
insert into recenzie values(493, 351, 50, 5.00, 'My thirteen year old Yorkshire Terrier loves Dogswell Happy Hips Chicken breast strips and the glucosomine has helped her arthritis a great deal.  She jumps and runs like a puppy again!  My five year old yorkie loves them too!  I highly recommend this product.', sysdate);
insert into recenzie values(494, 168, 324, 5.00, 'BURNED OUT ON COFFEE THIS TEA FILLS THE VOID PERFECTLY FOR ME.I DEFINITELT WILL PURCHASE MORE TEA IN FUTURE .TWININGS MAKES GREAT TEA.', sysdate);
insert into recenzie values(495, 239, 467, 5.00, 'I never in my life tasted such a good babka its crazy good! This is the real babka! That my gram mother use to make', sysdate);
insert into recenzie values(496, 146, 362, 5.00, 'This was a really good idea and the final product is outstanding. I use the decals on my car window and everybody asks where i bought the decals i made.  Two thumbs up!', sysdate);
insert into recenzie values(497, 466, 393, 5.00, 'Green Mountain is my favorite morning coffee.  It is a mild blend and is not the least bitter.  It is very smooth.', sysdate);
insert into recenzie values(498, 8, 220, 5.00, 'I love International Delight French Vanilla, lots better than Coffee Mate brand. I will only purchase International Delight Creamer. It works great when I travel except on an airplane.', sysdate);
insert into recenzie values(499, 62, 22, 5.00, 'These are delicious,with just the right touch of mustard and a nice crunch.I would definitely consider buying them again.The bags are generously filled,too.', sysdate);
insert into recenzie values(500, 453, 457, 4.00, 'Great Price, The best Maxwell House makes. It is a very good coffee for the price, less then $3.50 a can.', sysdate);
